import NavBar from './NavBar'
import MainBody from './MainBody'
import Footer from './Footer'

class App extends React.Component{
  render(){
    return (
      <div className="App">
        <NavBar />
        <MainBody />
        <Footer />
      </div>
    )
  }
}
